{'message': 'MAD（マッド-），指电玩文化、动漫文化、同人文化界别中的多媒体作品。一般作品为一段有关的影片剪辑，配以作者喜欢的音乐，近似同人MV 形式的存在。不同的地方是MAD片的重点在于影片，对有关动画或电玩致敬，而相对同人MV的重点则放在音乐之上。有一些是只作声音的剪辑或只有画面的剪辑亦可算作MAD。

“动漫”是指动画和漫画的合称与的缩写。

漫画的量词 应该是&quot;话&quot;', 'plat': 0, 'device': ''}

{'message': '这评论员完全不明白支持X86指令集构架意味着什么，苹果和这个比就算便宜一倍也毫无意义。
