{'message': '科普一下关于尸人为何要杀人 （节选自http://bbs.tianya.cn/post-filmtv-332764-7.shtml 原作者：牛肉小洋葱）

这里要注意的是，“杀死”这个词在尸人的世界中是有着另外的含义的。被杀死的你并不会真正的死亡，在红海的力量下，你会慢慢丧失人类的知性，变得跟其他尸人一样不老不死。换句话说，尸人对你的袭击并不是正常人角度上的“恶意”攻击，而是一种同化同类的需要。即消灭作为凡人存在的精神与肉体，一起共享永生不灭的生命果实。站在基督教话语体系的角度，尸人的行为其实与传播福音并无二致。
　　
　　
　　尸人的世界是人类的自由意志死亡之后的世界。尸人把人类思考的权利交还给了上帝，通过对理性的自残而获得了最为简单的快乐。在外人看来，尸人是丧失了人类意志的丑恶存在，而在尸人的眼里 ，世界是美丽的，空气中回荡着福音，天空中飞舞着天使。而自己永生不死的生命，就是上帝慈爱的最大证明。如果说吃下智慧果实就是人类的原罪，那么在死魂曲的故事中，尸人已经通过把智慧果实还给上帝而消除了自己的原罪，从而达到了宗教语言上的和谐。', 'plat': 0, 'device': ''}

